const Coursework = () => {
    return (
        <div id="coursework" className="coursework-page">
            <h2>Technical Coursework</h2>
            <div class = "classes">
                <h3>CS61A: Structure and Interpretation of Computer Programs</h3>
                <p class="project__description">
            ‚óè Built version-control system that utilizes SHA1 hashing system and serialization to maintain persistence of files within the program, with the ability to commit file changes, revert to previous versions, and create branches.
          </p>
            </div>




            </div>
    );
};

export default Coursework;
